import React from 'react';

function Home() {
  return (
    <div className="containerH">
      <div className="text-section">
        <h2 className="subtitle">We're Getting Married</h2>
        <h1 className="names">Anna & Dominic</h1>
        <h3 className="date">Saturday, August 15, 2026</h3>
        <p className="location">The Old Chapel, San Francisco</p>
        <button className="rsvp-button">RSVP</button>
      </div>
      <div className="image-section">
        <div className="couple-image">
          {/* Placeholder for the couple image */}
          <div className="image-placeholder">
            <span>Couple Image</span>
          </div>
        </div>
      </div>
    </div>
  )
}

export default Home;
